<!-- for fetching the email if it exist or not also email suggestions -->
<script>
    const emailInput = document.getElementById('email');
    const suggestionBox = document.getElementById('emailSuggestions');
    const feedback = document.getElementById('emailFeedback');
    let debounceTimer; // To avoid excessive fetch requests

    // Fetch suggestions and validate email in real-time while typing
    emailInput.addEventListener('input', function () {
        const query = this.value;

        // Clear debounce timer to avoid frequent fetches
        clearTimeout(debounceTimer);

        if (query.length > 1) {
            // Fetch suggestions after a short delay
            debounceTimer = setTimeout(() => {
                fetch(`fetch_emails.php?query=${encodeURIComponent(query)}`)
                    .then(response => response.json())
                    .then(data => {
                        suggestionBox.innerHTML = ''; // Clear previous suggestions

                        if (data.length > 0) {
                            suggestionBox.style.display = 'block'; // Show suggestion box
                            data.forEach(email => {
                                const suggestion = document.createElement('div');
                                suggestion.textContent = email;
                                suggestion.style.padding = '5px';
                                suggestion.style.cursor = 'pointer';

                                // Set input value when clicked
                                suggestion.addEventListener('mousedown', () => {
                                    emailInput.value = email; // Update input value
                                    suggestionBox.style.display = 'none'; // Hide suggestions
                                    validateEmail(email); // Validate the selected email
                                });

                                suggestionBox.appendChild(suggestion);
                            });
                        } else {
                            suggestionBox.style.display = 'none'; // Hide suggestion box if no results
                        }
                    })
                    .catch(error => {
                        console.error('Error fetching email suggestions:', error);
                        suggestionBox.style.display = 'none'; // Hide suggestion box on error
                    });

                // Validate email in real-time
                validateEmail(query);
            }, 300); // Delay for debounce (300ms)
        } else {
            suggestionBox.style.display = 'none'; // Hide suggestions if query is too short
            emailInput.style.border = '1px solid #ccc'; // Reset styles
            feedback.textContent = '';
            feedback.classList.remove('valid', 'invalid');
        }
    });

    // Validate email function
    function validateEmail(email) {
        if (email !== '') {
            fetch(`check_email.php?email=${encodeURIComponent(email)}`)
                .then(response => response.json())
                .then(data => {
                    const ownerNameInput = document.getElementById('ownername');
                    const contactInput = document.getElementById('contact');

                    if (data.exists) {
                        emailInput.style.border = '1px solid green';
                        feedback.textContent = 'Valid email address';
                        feedback.style.color = 'green';
                        feedback.classList.add('valid');
                        feedback.classList.remove('invalid');

                        // Populate the name and contact fields
                        ownerNameInput.value = data.name || ''; // Populate owner name
                        contactInput.value = data.contact || ''; // Populate contact number
                    } else {
                        emailInput.style.border = '1px solid red';
                        feedback.textContent = 'No Existing email address';
                        feedback.style.color = 'red';
                        feedback.classList.add('invalid');
                        feedback.classList.remove('valid');

                        // Clear the name and contact fields
                        ownerNameInput.value = '';
                        contactInput.value = '';
                    }
                })
                .catch(error => {
                    console.error('Error validating email:', error);
                });
        } else {
            emailInput.style.border = '1px solid #ccc';
            feedback.textContent = '';
            feedback.classList.remove('valid', 'invalid');
            document.getElementById('ownername').value = ''; // Clear the owner name field
            document.getElementById('contact').value = ''; // Clear the contact field
        }
    }




</script>




