<!-- lot iterations -->
<script>
	document.addEventListener('DOMContentLoaded', function() {
		const lotOwnedContainer = document.getElementById('lotOwnedContainer');
		let takenLots = []; // This will hold the taken lots from the database

		// Fetch taken lots from the database via AJAX
		fetch('check_lots.php')
			.then(response => response.json())
			.then(data => {
				takenLots = data;
				updateGraveColors(); // Update grave colors based on the fetched data
			})
			.catch(error => console.error('Error fetching taken lots:', error));

		const generateInputs = (count) => {
			lotOwnedContainer.innerHTML = ''; // Clear previous inputs
			for (let i = 0; i < count; i++) {
				const input = document.createElement('input');
				input.type = 'text';
				input.name = `LOT${i + 1}`; // Assign name LOT1, LOT2, ..., LOT24
				input.placeholder = `Lot ${i + 1}`;
				input.required = true; // Make input required
				lotOwnedContainer.appendChild(input);
			}
		};

		const lotTypes = {
			lawnlot: 1,
			court4: 4,
			court8: 8,
			estate12: 12,
			estate24: 24,
		};

		let allowedPrefix = ''; // Variable to store allowed prefix for IDs

		// Set default inputs and allowed prefix based on the default checked radio button
	generateInputs(lotTypes.lawnlot);
	// Update allowedPrefixes and set default for lawnlot
	allowedPrefixes = ['EVGM', 'TOL']; // Default to EVGM for lawnlot

	document.querySelectorAll('input[name="lottype"]').forEach(radio => {
		radio.addEventListener('change', function() {
			generateInputs(lotTypes[this.value]);
			// Set allowed prefixes based on the selected lot type
			if (this.value === 'court4' || this.value === 'court8') {
				allowedPrefixes = ['COS'];
			} else if (this.value === 'estate12' || this.value === 'estate24') {
				allowedPrefixes = ['SOL', 'PE']; // Set prefixes for estate12 and estate24
			} else if (this.value === 'lawnlot') {
				allowedPrefixes = ['EVGM', 'TOL']; // Set prefix for lawnlot
			} else {
				allowedPrefixes = []; // No restriction for other types
			}
			updateGraveColors(); // Update grave colors based on the new selection
		});
	});

	// Event listener for polygons and rects
	const polygons = document.querySelectorAll('polygon.st2');
	const rects = document.querySelectorAll('rect.st2');

	const handlePolygonClick = (event) => {
		const polygonId = event.target.id;
		toggleSelection(event.target, polygonId);
	};

	const handleRectClick = (event) => {
		const rectId = event.target.id;
		toggleSelection(event.target, rectId);
	};

	polygons.forEach(polygon => {
		polygon.addEventListener('click', handlePolygonClick);
	});

	rects.forEach(rect => {
		rect.addEventListener('click', handleRectClick);
	});

	// Function to toggle selection of an element
	const toggleSelection = (element, id) => {
		if (takenLots.includes(id)) {
			alert('This lot is already taken.');
			return; // Exit the function if the lot is taken
		}

		// Only proceed if the ID matches the allowed prefixes
		if (!isAllowedId(id)) {
			alert('Please select a valid lot type.');
			element.style.fill = '#343131'; // Change color for non-allowed IDs
			return;
		}

		// Toggle selection
		if (element.classList.contains('selected')) {
			element.classList.remove('selected');
			element.style.fill = isAllowedId(id) ? '' : '#343131'; // Reset color if needed
			removeLotInput(id);
		} else {
			if (!isIdInInputs(id) && hasEmptyInput()) {
				element.classList.add('selected');
				element.style.fill = ''; // Reset color to default for selected
				insertLotInput(id);
			} else {
				console.log('No empty input available or ID already exists.');
			}
		}
	};

	// Function to check if the ID is allowed based on the selected lot type
	const isAllowedId = (id) => {
		return allowedPrefixes.length === 0 || allowedPrefixes.some(prefix => id.startsWith(prefix));
	};

	// Function to insert the ID into the lot inputs
	const insertLotInput = (id) => {
		const emptyInput = Array.from(lotOwnedContainer.children).find(input => input.value === '');

		if (emptyInput) {
			emptyInput.value = id;
		} else {
			console.log('No empty input available to insert ID.');
		}
	};

	// Function to remove the ID from the lot inputs
	const removeLotInput = (id) => {
		const inputWithId = Array.from(lotOwnedContainer.children).find(input => input.value === id);

		if (inputWithId) {
			inputWithId.value = '';
		}
	};

	// Function to check if the ID is already in the inputs
	const isIdInInputs = (id) => {
		return Array.from(lotOwnedContainer.children).some(input => input.value === id);
	};

	// Function to check if there are any empty inputs available
	const hasEmptyInput = () => {
		return Array.from(lotOwnedContainer.children).some(input => input.value === '');
	};

	// Function to update the color of graves based on the allowed prefix and taken lots
	const updateGraveColors = () => {
		const elements = document.querySelectorAll('polygon.st2, rect.st2');
		elements.forEach(element => {
			const id = element.id;
			if (takenLots.includes(id)) {
				element.style.fill = '#A98B98'; // Change color to red for taken lots
				element.classList.add('disabled'); // Disable the element
			} else if (allowedPrefixes.some(prefix => id.startsWith(prefix))) {
				element.style.fill = '#41B06E'; // Change color to green for allowed IDs
			} else {
				element.style.fill = '#343131'; // Default color for non-matching IDs
			}
		});
	};

	});

</script>
