<script>
    ///////MAPPING CONTROLS
    ////////////////////////////////////////////////////////////////////////////
        var svgContainer = document.getElementById('svgContainer');
        var svg = svgContainer.querySelector('svg');
        var isDragging = false;
        var lastX, lastY;
        var panStrength = 0.2; // Adjust the panning strength as needed

        // Original viewBox dimensions
        var originalViewBoxWidth = svg.viewBox.baseVal.width;
        var originalViewBoxHeight = svg.viewBox.baseVal.height;

        // Add zoom functionality using mouse wheel
        svgContainer.addEventListener('wheel', function(event) {
        event.preventDefault(); // Prevent default zooming behavior

        var zoom = event.deltaY > 0 ? 1.1 : 0.9; // Reverse the zoom direction

        // Apply zoom to the SVG
        zoomSvg(zoom, event.clientX, event.clientY);
        });

        // Add panning functionality
        svgContainer.addEventListener('mousedown', function(event) {
        isDragging = true;
        lastX = event.clientX;
        lastY = event.clientY;
        svg.style.cursor = 'grabbing';
        });

        svgContainer.addEventListener('mousemove', function(event) {
        if (isDragging) {
            var deltaX = (event.clientX - lastX) * panStrength;
            var deltaY = (event.clientY - lastY) * panStrength;
            lastX = event.clientX;
            lastY = event.clientY;

            // Apply panning to the SVG
            panSvg(deltaX, deltaY);
        }
        });

        window.addEventListener('mouseup', function() {
        isDragging = false;
        svg.style.cursor = 'grab';
        });

        // Function to zoom the SVG
        function zoomSvg(zoom, clientX, clientY) {
        var rect = svg.getBoundingClientRect();
        var mouseX = (clientX - rect.left) / rect.width;
        var mouseY = (clientY - rect.top) / rect.height;

        // Calculate new viewBox
        var viewBox = svg.viewBox.baseVal;
        var newWidth = viewBox.width * zoom;
        var newHeight = viewBox.height * zoom;
        var newX = viewBox.x - (newWidth - viewBox.width) * mouseX;
        var newY = viewBox.y - (newHeight - viewBox.height) * mouseY;

        if (newWidth > originalViewBoxWidth+100 || newHeight > originalViewBoxHeight+1000) {
        return;
    }

        // Apply zoom with smooth transition
        svg.style.transition = 'transform 0.2s ease';
        svg.style.transformOrigin = (mouseX * 100) + '% ' + (mouseY * 100) + '%';
        svg.setAttribute('viewBox', `${newX} ${newY} ${newWidth} ${newHeight}`);
        }

        // Function to pan the SVG
        function panSvg(deltaX, deltaY) {
        var viewBox = svg.viewBox.baseVal;
        var newX = viewBox.x - deltaX;
        var newY = viewBox.y - deltaY;
        svg.setAttribute('viewBox', `${newX} ${newY} ${viewBox.width} ${viewBox.height}`);
        }
        svgContainer.addEventListener('contextmenu', function(event) {
    event.preventDefault();
    });

    svgContainer.addEventListener('auxclick', function(event) {
    // Check if the clicked button is the middle mouse button (button value 1)
    if (event.button === 1) {
        event.preventDefault(); // Prevent default action
    }
    });
    svgContainer.addEventListener('contextmenu', function(event) {
    event.preventDefault();
    });
    ////////////////////////////////////////////////////////////////////////////
    ////NAME AND DATE OF DEAD PERSON SHOWING WHEN GRAVE IS HOVERED
    document.querySelectorAll('.st2').forEach(item => {
    item.addEventListener('mouseenter', event => {
        const messageBox = document.getElementById('messageBox');
        const messageText = document.getElementById('messageText');
        const polygonId = item.id; // Get the ID of the polygon

        // Display the ID of the polygon or rect
        messageText.textContent = `ID: ${polygonId}`;

        fetch(`connection.php?id=${polygonId}`)
        .then(response => response.json())
        .then(data => {
            let messageContent = ''; // Variable to store the aggregated message content
            
            if (data && data.length > 0) {
            data.forEach(record => {
                const [year, month, day] = record.date_of_death.split('-');
                const formattedDate = `${getMonthName(month)} ${parseInt(day)}, ${year}`;
                messageContent += `Name: ${record.name}<br>Date of Death: ${formattedDate}<br> Location: ${record.grave_location}<br><br>`;
            });
            } else {
            messageContent = "Vacant burial lot";
            }
            messageText.innerHTML += `<br>${messageContent}`;

            messageBox.style.display = 'block';
            messageBox.style.left = (event.pageX - 200) + 'px';
            messageBox.style.top = (event.pageY - messageBox.offsetHeight) + 'px';
        })
        .catch(error => {
            console.error('Error fetching message text:', error);
        });
    });

    item.addEventListener('mouseleave', event => {
        const messageBox = document.getElementById('messageBox');
        messageBox.style.display = 'none';
    });
    });
    function getMonthName(monthNumber) {
    const months = ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December'];
    return months[parseInt(monthNumber) - 1];
    }
    ///////////////////////////////////////////////////////////////////////////
</script>

